L["|nOnly show raid frames if there are more than 5 members in your group.|nIf disabled, show raid frames when in raid, show party frames when in party."] = "|nОтображать только рейд-Фреймы, если в вашей группе более 5 участников. |nЕсли отключено, Показывать рейд-Фреймыы в рейде, показывать Групп-фреймы, когда в группе."
L["|nOpen your spell book to configure click to cast."] = "|nОткройте книгу заклинаний, чтобы настроить 'клик-каст'."
L["|nPlay DotA-like sounds on PvP killing blows."] = "|nПроиграть похожие на DotA звуки при убийственных ударах в PvP."
L["|nPriority limit in 1-6.|nPress ENTER KEY when you finish typing."] = "|nОграничение приоритета 1-6.|nНажмите клавишу ENTER после ввода."
L["|nProvides necessary combat infomation, including damage healing and events (dodge, parry, absorb etc...)."] = "Показывает необходимую информацию, включая исцеление и урон (уклонение, парирование, поглощение и т.д.)"
L["|nRemind you when lack of your own class spell.|nSupport: Stamina, Poisons, Arcane Intellect, Battle Shout."] = "|nНапоминание для классовых способностей.|nПоддержка: Выносливость, Яды, Интелект, Боевой крик."
L["|nReplace the current profile with the selected one, requires UI reload."] = "|nЗамените текущий профиль выбранным, требуется перезагрузка пользовательского интерфейса."
L["|nReplace the selected profile with the current using one."] = "|nЗамените выбранный профиль текущим с помощью одного."
L["|nReset your current profile, and load default settings. Requires UI reload."] = "|nСбросьте текущий профиль и загрузите настройки по умолчанию. Требуется перезагрузка пользовательского интерфейса."
L["|nSetup whisper invite keywords. If you have more than one word, press key SPACE in between."] = "|nНастройте ключевые слова для приглашения шепотом. Если у вас более одного слова, Используйте ПРОБЕЛ между ними."
L["|nShow an animated alert when you enter/leave combat."] = "|nПоказывать анимированное оповещение при входе/выходе из боя."
L["|nShow blizzard combat text of damage and healing."] = "|nПоказывать blizzard комбат-текст."
L["|nShow custom major debuffs in raid and dungeons."] = "|nПоказывать важные дебаффы в рейде и подземельях."
L["|nShow the action bar icons desaturated when they are on cooldown."] = "|nОбесцвечивать значки панели умений, когда они находятся на перезарядке."
L["|nSimplify channels name.|ne.g. [1: General] to [1] [Guild] to [G]"] = "|nУпрощение название каналов. | Например,[1: General] в [ 1] [Гильдия] в [G]"
L["|nSimplify chat messages from damage meters like Details and instead provides a chat-link to provide the blocked damage statistics in a popup."] = "|nУпрощение сообщений чата для измерителей урона, таких как Details, и вместо этого показывать ссылку чата для предоставления статистики урона во всплывающем окне."
L["|nSpell's priority when visible.|nWhen multiple spells exist, it only remain the one that owns highest priority.|nDefault priority is 2, if you leave it blank.|nThe maximun priority is 6, and the icon would flash if you set so."] = "|nSpell's priority when visible.|nWhen multiple spells exist, it only remain the one that owns highest priority.|nDefault priority is 2, if you leave it blank.|nThe maximun priority is 6, and the icon would flash if you set so."
L["|nSwitch to the selected profile, requires UI reload."] = "|nПереключиться на выбранный профиль, требуется перезагрузка пользовательского интерфейса."
L["|nThe text will fade out after not receiving a new message for 2 minutes."] = "|nТекст исчезнет после того, как новое сообщение не будет получено в течение 2 минут."
L["|nTrack your spell cooldown using a pulse icon in the center of the screen."] = "|nУведомляющий значок который плавно появляется и пропадает в центре экрана при готовности спасобности."
L["|nYou can mouse wheel on actionbar button, and send its cooldown status to your group."] = "|nВы можете прокрутить колесико мыши на кнопке панели умений и отправить ее статус восстановления вашей группе."
L["|nYou can use TAB key to cycle channels after the input box is activated."] = "|nВы можете использовать клавишу TAB для переключения каналов после активации поля ввода."
